LA FABRICACIÓN, LA COMPRAVENTA, LA IMPORTACIÓN,  LA EXPORTACIÓN, LA INSTALACIÓN, LA EXPLOTACIÓN Y EL MONTAJE:
DE SISTEMAS Y EQUIPOS HIDRÁULICOS DE TODA CLASE PARA USOS INDUSTRIALES, MARINOS Y DE AVIACIÓN; 
DE MAQUINARIA, ÚTILES, HERRAMIENTAS, EQUIPOS Y ACCESORIOS ELÉCTRICOS Y MECÁNICOS; 
DE MÁQUINAS Y ARTÍCULOS DE OFICINA EN GENERAL, SUMADORAS, CALCULADORAS, COMPUTADORAS, ARCHIVADORES, CAJAS DE CAUDALES Y ARCHIVOS DE SEGURIDAD,
DE APARATOS, INSTRUMENTOS Y DISPOSITIVOS PARA LA REPRODUCCIÓN DE DOCUMENTOS, IMÁGENES Y SONIDOS, FOTOCOPIADORAS, FOTOREPRODUCTORAS, MÁQUINAS DE IMPRIMIR Y ESCRIBIR; 
DE EQUIPOS PARA EL TRATAMIENTO DE DATOS Y PARA EL TRATAMIENTO DE INFORMACIÓN DE TODA CLASE DE SISTEMAS DE CONTROL DIGITAL;
DE GIROSCOPIOS Y APARATOS ESTABILIZADORES, 
DE COMPASES Y CUALESQUIERA INSTRUMENTOS TÉCNICOS PARA LA INVESTIGACÓN Y EL CONTROL DE MOVIMIENTOS;
EL ESTUDIO, LA OBTENCIÓN, LA ADQUISICIÓN Y EL PERFECCIONAMIENTO DE INVENTOS Y CONOCIMIENTOS TÉCNICOS, PATENTES, LICENCIAS, MODELOS, DIBUJOS Y MARCAS, SU APLICACIÓN, EXPLOTACIÓN, VENTA, ENAJENACIÓN, ARRENDAMIENOT, LICENCIA Y CONCESIÓN;
LA  INVESTIGACIÓN CIENTÍFICA Y TÉCNICA, LA CONSULTA  Y EL ASESORAMIENTO A OTRAS EMPRESAS PARA LA APLICACIÓN Y EL DESARROLLO DE CONOCIMIENTOS CIENTÍFICOS Y TÉCNICOS
